    "cradle-of-the-earthquake-exploring-the-underwater-san-andreas-fault-on-the-r-v-pacific-storm-an",nt"isopen":
    false,nt"url": null,nt"notes": "Over one hundred years after the devastating
    Great 1906 Earthquake that nearly destroyed San Francisco, this expedition explored
    the Northern San Andreas Fault, the history of past earthquakes, and the intertwined
    relationships between large earthquakes and biologic diversity along this, the fastest
    moving fault in western North America. The expedition combined cutting-edge technology
    with the use of an innovative, fuel-efficient vessel to explore the past and predict
    the future of this unexplored geobiologic system.",nt"license_title": null,nt"extras":
